import React, { FC, Suspense, lazy, useState } from "react"
import styles from "./button.module.css"
import { Route } from "react-router-dom"

const PopupTweet = lazy(() => import("../../../PopupTweet/PopupTweet"))

type props = {
  SetPostNews: () => void
}

export const Button: FC<props> = React.memo(
  ({ SetPostNews }) => {
    const [popup, setPopup] = useState(false)

    const suspension = () => {
      return (
        <Suspense fallback={<div>Loading...</div>}>
          <Route
            path="/"
            component={() => <PopupTweet SetPostNews={SetPostNews} setPopup={setPopup} />}
          />
        </Suspense>
      )
    }

    const onClick = () => {
      setPopup((prev) => !prev)
    }

    return (
      <>
        <button type="button" className={styles.btnFont} data-testid="testBtn" onClick={onClick}>
          Tweet
        </button>
        {popup ? suspension() : null}
      </>
    )
  },
  (v, n) => {
    console.log(n)
    return false
  }
)
